Problem:
Find the value of $a$ such that the following series converges: \begin{{align*}\sum\limits_{n=1}^\infty {a^n} = \frac{{1}}{{1-a}}.\end{align*}}
Solution:
We have that $$\sum\limits_{n=1}^\infty {a^n} = \frac{{1}}{{1-a}}.$$
We can solve for $a$ by dividing both sides by $\boxed{{1-a}}$: \begin{{align*}\frac{{1}}{{1-a}} = \sum\limits_{n=1}^\infty {a^n} \Rightarrow\frac{1}{1-a} = \boxed{{a}}.\end{align*}}
Final Answer: The final answer is $a$. I hope it is correct.

